import React from "react";

import "./App.css";

const App = () => {
  const nav_content = ["Home", "contact", "Address", "About"];
  const nav_list = nav_content.map((items) => <li>{items.nav_content}</li>);
  return <>{nav_list}</>;
};

export default App;
